function App() {
  return (
    <div className="">
      <Menu></Menu>
      <main>
      <div className="helper">
          <h1>MasterMind GAMES</h1>    
      </div>
      <div className="top"></div>
      <Plateau></Plateau>
      <div className="ecar"></div>
      <Interact></Interact>
</main>
    </div>
  );
}

export default App;
